-- Tabela: operacaos
CREATE TABLE operacaos (
    id         INTEGER  NOT NULL
                        PRIMARY KEY AUTOINCREMENT,
    tipo       INTEGER  NOT NULL
                        DEFAULT 'saida',
    antena_id  INTEGER  NOT NULL,
    tag_id     INTEGER  NOT NULL,
    user_id    INTEGER  NOT NULL,
    created_at DATETIME,
    updated_at DATETIME,
    FOREIGN KEY (
        antena_id
    )
    REFERENCES antenas (id),
    FOREIGN KEY (
        tag_id
    )
    REFERENCES tags (id),
    FOREIGN KEY (
        user_id
    )
    REFERENCES users (id) 
);


-- Tabela: operations
CREATE TABLE operations (
    antena_id   INTEGER  NOT NULL,
    tag_id      INTEGER  NOT NULL,
    user_id     INTEGER  NOT NULL,
    id          INTEGER  NOT NULL
                         PRIMARY KEY AUTOINCREMENT,
    operations  TEXT     NOT NULL,
    tipo        TEXT     NOT NULL,
    antena      TEXT     NOT NULL,
    funcionario TEXT     NOT NULL
                         DEFAULT 'Deslogado',
    created_at  DATETIME,
    updated_at  DATETIME,
    FOREIGN KEY (
        antena_id
    )
    REFERENCES antenas (id),
    FOREIGN KEY (
        tag_id
    )
    REFERENCES tags (id),
    FOREIGN KEY (
        user_id
    )
    REFERENCES users (id) 
);


-- Tabela: password_resets
CREATE TABLE password_resets (
    email      VARCHAR  NOT NULL,
    token      VARCHAR  NOT NULL,
    created_at DATETIME
);


-- Tabela: personal_access_tokens
CREATE TABLE personal_access_tokens (
    id             INTEGER  NOT NULL
                            PRIMARY KEY AUTOINCREMENT,
    tokenable_type VARCHAR  NOT NULL,
    tokenable_id   INTEGER  NOT NULL,
    name           VARCHAR  NOT NULL,
    token          VARCHAR  NOT NULL,
    abilities      TEXT,
    last_used_at   DATETIME,
    created_at     DATETIME,
    updated_at     DATETIME
);


-- Tabela: sessions
CREATE TABLE sessions (
    id            VARCHAR NOT NULL,
    user_id       INTEGER,
    ip_address    VARCHAR,
    user_agent    TEXT,
    payload       TEXT    NOT NULL,
    last_activity INTEGER NOT NULL,
    PRIMARY KEY (
        id
    )
);

INSERT INTO sessions (
                         id,
                         user_id,
                         ip_address,
                         user_agent,
                         payload,
                         last_activity
